import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Axios from 'axios';


import { TextField } from '@material-ui/core';
import InputMask from "react-input-mask";
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';
import SelectField from '@material-ui/core/Select';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import FormErrors from './layout/FormErrors.js';
import Alert from '@material-ui/lab/Alert';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import Autocomplete from '@material-ui/lab/Autocomplete';
import PhoneInput from 'react-phone-number-input';
import MaskedInput from 'react-text-mask';









class Stat extends Component {


    state = {
        comments: []
    }

    componentDidMount() {
      const axiosConfig = {
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
            'mode': 'no-cors'

        }

    }



        Axios.get('http://localhost:8080/all', axiosConfig)
        .then(response => {

            if (response.status != 200){
                console.log("ERRORRRRRR!!");


            } else {
                console.log(response.data);
                this.setState({comments: response.data});
                console.log(this.state.comments);
                // this.setState({load: true});
                // this.setState({Userlist: response.data});
                // console.log(this.state.Userlist[0].id);
                // this.state.Userlist.map((user) => console.log(user.id));
                // console.log(JSON.parse(this.state.Userlist));
                // console.log(JSON.parse(response.data))

            }

        })
    }


    render(){
      return(
        <div>
          <TableContainer component={Paper}>
                        <Table className={this.useStyles.table} aria-label="simple table">
                            <TableHead>
                            <TableRow>
                                <TableCell align="left">Предмет</TableCell>
                                {/* <TableCell align="right">Fat&nbsp;(g)</TableCell>
                                <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                                <TableCell align="right">Protein&nbsp;(g)</TableCell> */}

                                {this.state.dates.map((date) => (

                                <TableCell align="left">

                                    {date}


                                </TableCell>

                                ))}
                            </TableRow>
                            </TableHead>
                            <TableBody>
                            {this.state.subjects.map((subject, index) => (
                                this.subIndex = index,
                                <TableRow key={index}>
                                <TableCell component="th" scope="row">{subject}</TableCell>


                                {


                                this.state.marks.map((actualMark, index) => (

                                    console.log(index),


                                <TableCell align="center">{actualMark[this.subIndex]} </TableCell>

                                ))}


                                </TableRow>
                            ))}
                            </TableBody>
                        </Table>
                        </TableContainer>
        </div>
      )
    }

}

export default Stat;
